  of digital files is restricted to research and educational purposes","staffOnly":false,"instanceNoteTypeId":"f677d908-69c6-4450-94a6-abbcf94a1ee5"},{"note":"The
  Stanford News Service is part of the Office of University Communications. The News
  Service reports and disseminates much of the University''s news, via the STANFORD
  REPORT daily news email. Previously the department was known as the Stanford News
  and Publications Service, and was a part of the Public Affairs Office. The News
  Service produced the weekly CAMPUS REPORT (later STANFORD REPORT) and the monthly
  STANFORD OBSERVER. The News Service was originally created to take over some functions
  previously performed by the General Secretary''s Office. In 1946 a news and information
  office was created when Frederic O. Glover was appointed Director of Information;
  when Glover became secretary to the president, Peter C. Allen was named director
  of Information and Publications. In 1962, The office was expanded and became part
  of the newly created University Relations Office with Peter Allen as director of
  Publications and Robert W. Beyers as director of the News Service. News and Publications
  was again united when Allen was named Associate director of University Relations
  (and later University editor), and Beyers became director of News and Publications","staffOnly":false,"instanceNoteTypeId":"c636881b-8927-4480-ad1b-8d7b27b4bbfe"},{"note":"Administrative
